export const addNewFolder = (addNewFodler) => ({
    type: 'ADD_NEW_FOLDER',
    addNewFodler,
});

export const addRecomendedFolder = (addRecomendedFodler) => ({
    type: 'ADD_RECOMENDED_FOLDER',
    addRecomendedFodler,
});

export const setInputText = (TextInput) => ({
    type: 'SET_TEXT',
    payload: TextInput,
});
